// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;
import "./libraries/StringLibrary.sol";
import "./models/TipoEnergia.sol";
import "./TokenErc20/ERC20.sol";
import "./models/TipoEnergiaFactory.sol";
import "./models/InfoContrato.sol";
import "./models/Agente.sol";
import "./Comercializador.sol";
import "./BancoEnergia.sol";

contract Generador is Agente {
    TipoEnergiaFactory private factoryEnergia;
    address private bancoEnergia;
    mapping(string => TipoEnergia) private tiposEnergiasGenerador;
    mapping(address => TipoEnergia) private EnergiasComprador;
    using StringLibrary for string;

    //Evento de compra de tokens
    event compraEnergia(uint256, string, address);

    constructor(
        InfoContrato memory _infoContrato,
        address _reguladorMercado,
        address _bancoEnergia
    ) {
        reguladorMercado = _reguladorMercado;
        infoContrato = InfoContrato(
            address(this),
            _infoContrato.owner,
            _infoContrato.nit,
            _infoContrato.empresa,
            _infoContrato.contacto,
            _infoContrato.telefono,
            _infoContrato.correo,
            _infoContrato.departamento,
            _infoContrato.ciudad,
            _infoContrato.direccion,
            nullAddress,
            _infoContrato.tipoComercio
        );
        factoryEnergia = new TipoEnergiaFactory();
        bancoEnergia = _bancoEnergia;
    }

    function GenerarNuevaEnergia(
        string memory nombreTipoEnergia,
        uint256 _cantidadEnergia
    ) public authorize(msg.sender) {
        tiposEnergiasGenerador[nombreTipoEnergia] = factoryEnergia
            .generarNuevaEnergia(nombreTipoEnergia, _cantidadEnergia);

        BancoEnergia(bancoEnergia).onCantidadEnergiaChange(
            nombreTipoEnergia,
            _cantidadEnergia,
            Operacion.adicionar
        );
    }

    function InyectarEnergia(
        string memory nombreTipoEnergia,
        uint256 _cantidadEnergia
    ) public authorize(msg.sender) {
        require(
            address(tiposEnergiasGenerador[nombreTipoEnergia]) !=
                Validations.nullAddress,
            "El tipo de energia no existe"
        );
        tiposEnergiasGenerador[nombreTipoEnergia].addCantidadEnergia(
            _cantidadEnergia
        );
        BancoEnergia(bancoEnergia).onCantidadEnergiaChange(
            nombreTipoEnergia,
            _cantidadEnergia,
            Operacion.adicionar
        );
    }

    //_dirOwnerContrato, direccion del owner del cliente
    function ComprarEnergia(
        uint256 cantidadEnergia,
        string memory tipoEnergia,
        address _dirOwnerContrato
    ) public {
        //Verificar que el tipo de energia exista
        address dirTipoEnergia = address(tiposEnergiasGenerador[tipoEnergia]);
        require(
            dirTipoEnergia != nullAddress,
            "El tipo de energia, no se encuentra dentro del catalogo"
        );

        //Comprobar que la cantiadad de energia solicitada no supere la producida
        uint256 cantidadEnergiaDisponible = tiposEnergiasGenerador[tipoEnergia]
            .getCantidadEnergia();
        require(
            cantidadEnergiaDisponible >= cantidadEnergia,
            "No puede comprar mas energia de la disponible"
        );

        //Caluclar el coste de la energia
        uint256 costeEnergia = cantidadEnergia *
            tiposEnergiasGenerador[tipoEnergia].calcularPrecio();
        //Verficar que el comprador cuente con fondos suficientes
        require(
            costeEnergia <=
                ReguladorMercado(reguladorMercado).MisTokens(_dirOwnerContrato),
            "No tienes tokens suficientes"
        );

        //Transferencia de los tokens al owner del contrato
        ReguladorMercado(reguladorMercado).IntercambiarTokens(
            _dirOwnerContrato,
            infoContrato.owner,
            msg.sender,
            costeEnergia
        );

        //Descontar la energia disponible
        tiposEnergiasGenerador[tipoEnergia].restarCantidadEnergia(
            cantidadEnergia
        );
        BancoEnergia(bancoEnergia).onCantidadEnergiaChange(
            tipoEnergia,
            cantidadEnergia,
            Operacion.restar
        );
        EnergiasComprador[_dirOwnerContrato] = tiposEnergiasGenerador[
            tipoEnergia
        ];
        emit compraEnergia(cantidadEnergia, tipoEnergia, _dirOwnerContrato);
    }

    function getTipoEnergia(string memory _tipoEnergia)
        public
        view
        returns (TipoEnergia)
    {
        return tiposEnergiasGenerador[_tipoEnergia];
    }

    function getCantidadEnergia(string memory _tipoEnergia)
        public
        view
        returns (uint256)
    {
        return tiposEnergiasGenerador[_tipoEnergia].getCantidadEnergia();
    }

    function getEnergiaComprador(address _dirOwnerContrato)
        public
        view
        returns (TipoEnergia)
    {
        return EnergiasComprador[_dirOwnerContrato];
    }

    function contratarComercializador(address _contratoComercializador)
        public
        authorize(msg.sender)
    {
        uint256 tipoComercializador = Comercializador(_contratoComercializador)
            .getTipoContrato();
        require(
            tipoComercializador == 1,
            "El comercializador debe ser de tipo Generador"
        );
        infoContrato.comercializador = _contratoComercializador;
        Comercializador(_contratoComercializador).setClientesComercializador(
            infoContrato
        );
    }
